, and Africa. The company offers on-net Internet access and private network services to law firms, financial services firms, and advertising and marketing firms, as well as heath care providers, educational institutions and other professional services businesses, other Internet service providers, telephone companies, cable television companies, Web hosting companies, media service providers, mobile phone operators, content delivery network companies, and commercial content and application service providers. It also provides Internet access and private network services to customers that are not located in buildings directly connected to its network; and on-net services to customers located in buildings that are physically connected to its network. In addition, the company offers off-net services to corporate customers using other carriers' circuits to provide the last mile portion of the link from the customers' premises to the network. Further, it operates data centers that allow its customers to collocate their equipment and access the network. The company operates 54 data centers and provides facilities to 3,035 buildings and on-net services to 1,817 to multi-tenant office buildings. It serves primarily to small and medium-sized businesses, communications service providers, and other bandwidth-intensive organizations. Cogent Communications Holdings, Inc. was founded in 1999 and is headquartered in Washington, the District of Columbia.",null,"Accolade, Inc., together with its subsidiaries, develops and provides technology-enabled solutions that help people to understand, navigate, and utilize the healthcare system and their workplace benefits in the United States. The company offers a platform with cloud-based technology and multimodal support from a team of health assistants and clinicians, including nurses, physician medical directors, and behavioral health specialists. It also provides second opinion consultation and health care decision support services. The company serves employers who provide their employees and their employees' families a single place to turn for their health, healthcare, and benefits needs. Accolade, Inc. was incorporated in 2007 and is headquartered in Plymouth Meeting, Pennsylvania.","Accolade, Inc., together with its subsidiaries, develops and provides technology-enabled solutions that help people to understand, navigate, and utilize the healthcare system and their workplace benefits in the United States. The company offers a platform with cloud-based technology and multimodal support from a team of health assistants and clinicians, including nurses, physician medical directors, and behavioral health specialists. It also provides second opinion consultation and health care decision support services. The company serves employers who provide their employees and their employees' families a single place to turn for their health, healthcare, and benefits needs. Accolade, Inc. was incorporated in 2007 and is headquartered in Plymouth Meeting, Pennsylvania.","Accolade, Inc., together with its subsidiaries, develops and provides technology-enabled solutions that help people to understand, navigate, and utilize the healthcare system and their workplace benefits in the United States. The company offers a platform with cloud-based technology and multimodal support from a team of health assistants and clinicians, including nurses, physician medical directors, and behavioral health specialists. It also provides second opinion consultation and health care decision support services. The company serves employers who provide their employees and their employees' families a single place to turn for their health, healthcare, and benefits needs. Accolade, Inc. was incorporated in 2007 and is headquartered in Plymouth Meeting, Pennsylvania.","Accolade, Inc., together with its subsidiaries, develops and provides technology-enabled solutions that help people to understand, navigate, and utilize the healthcare system and t arious accounts, and credit card services. It primarily serves small to medium-sized businesses, professional concerns, individuals, associations, organizations, and governmental authorities. As of December 31, 2021, the company operated 90 locations in Mississippi, Alabama, Florida, Georgia, and Louisiana. The First Bancshares, Inc. was incorporated in 1995 and is headquartered in Hattiesburg, Mississippi.","Frontdoor, Inc. provides home service plans in the United States. The company's home service plans cover the repair or replacement of principal components of approximately 20 home systems and appliances, including electrical, plumbing, water heaters, refrigerators, dishwashers, and ranges/ovens/cooktops, as well as electronics, pools, and spas and pumps; and central heating, ventilation, and air conditioning systems. It also offers ProConnect on-demand home services business and Streem, a technology platform that uses augmented reality, computer vision, and machine learning that helps home service professionals quickly and accurately diagnose breakdowns and complete repairs. The company serves homeowners under the American Home Shield, HSA, Landmark Home Warranty, OneGuard, Frontdoor, and Streem brands. The company was founded in 1971 and is headquartered in Memphis, Tennessee.",null,"Canadian Solar Inc., together with its subsidiaries, designs, develops, manufactures, and sells solar ingots, wafers, cells, modules, and other solar power and battery storage products in Asia, the Americas, Europe, and internationally. The company operates through two segments, Canadian Solar Inc. (CSI) Solar and Global Energy. The CSI Solar segment offers standard solar modules and battery storage solutions, as well as solar system kits that are a ready-to-install packages comprising inverters, racking systems, and other accessories; and engineering, procurement, and construction (EPC) services. The Global Energy segment engages in the development, construction, maintenance, and sale of solar and battery storage projects; operation of solar power plants; and sale of electricity. This segment also provides operation and maintenance (O&amp;M) services, including monitoring, inspections, repair, and replacement of plant equipment; and site management and administrative support services for solar projects, as well as asset management services. As of January 31, 2021, this segment had a fleet of solar power plants in operation with an aggregate capacity of approximately 445 MWp. The company serves distributors, system integrators, project developers, and installers/EPC companies. It sells its products primarily under its Canadian Solar brand name; and on an OEM basis. The company was incorporated in 2001 and is headquartered in Guelph, Canada.","CommScope Holding Company, Inc. provides infrastructure solutions for communications and entertainment networks. It operates through four segments: Broadband Networks (Broadband), Outdoor Wireless Networks (OWN), Venue and Campus Networks (VCN), and Home Networks (Home). The Broadband segment provides converged cable access platforms, passive optical networking products, video systems, access technologies, fiber and coaxial cables, fiber and copper connectivity products, and hardened closures to the telco and cable provider broadband market. The OWN segment provides base station antennas, radio frequency filters, tower connectivity, microwave antennas, metro cell products, cabinets, steel towers, accessories, Spectrum Access System, and Comsearch products to the macro and metro cell markets. The VCN segment offers Wi-Fi and switching, distributed antenna systems, licensed and unlicensed small cells, enterprise fiber, and copper infrastructures for campuses, venues, data centers, and buildings. The Home segment provides devices and related software, and management solutions that offer residential connectivity and services to subscribers, such as digital subscriber lines, cable modems, and telephony and data gateways; and set top boxes and software that support cable, satellite, and Internet protocol television content delivery, which include digital video recorders, high definition set top boxes, and hybrid set top devices. It offers its products and services through specialized resellers and distributors, satellite video distributors, and system integrators, as well as directly to customers in the United States, Europe, the Middle East, Africa, the Asia Pacific, the Caribbean, Latin America, and Canada. The company was formerly known as Cedar I Holding Company, Inc. and changed its name to CommScope Holding Company, Inc. in January 2011. CommScope Holding Company, Inc. was founded in 1976 and is headquartered in Hickory, North Carolina.","Commercial Vehicle Group, Inc., together with its subsidiaries, designs, manufactures, produces, and sells components and assemblies in North America, Europe, and the Asia-Pacific regions. It operates in four segments: Vehicle Solutions, Warehouse Automation, Electrical Systems, and Aftermarket &amp; Accessories. The company offers electrical wire harness assemblies that function as current carrying devices in providing electrical interconnections for gauges, lights, control functions, power circuits, powertrain and transmission sensors, emissions systems, and other electronic applications on commercial and other vehicles; and panel assemblies. It also offers electro-mechanical assemblies, such as box builds, complex automated and robotic assemblies, and large multi-cabinet control cabinets with power distribution and cabling; vinyl or cloth-covered appliqu\u00e9s, armrests, map pocket compartments, and sound-reducing insulations; instrument panels; and plastics decorating and finishing products. In addition, it provides cab structures; design products, including armrests, grab handles, storage systems, floor coverings, floor mats, sleeper bunks, headliners, wall panels, and privacy curtains; and mirrors, wipers, and controls used in commercial, military and specialty recreational vehicles. Further, it offers seats and seating systems, such as mechanical and air suspension, static and military seats, and bus, as well as seats for medium-and heavy-duty trucks (MD/HD trucks); office seating products; and seats, parts, and components for the aftermarket. The company supplies its products and systems for the commercial vehicle market comprising the MD/HD truck market; and MD/HD truck, bus, construction, mining, agricultural, military, industrial, municipal, off-road recreational, and specialty vehicle markets. Commercial Vehicle Group, Inc. was incorporated in 2000 and is headquartered in New Albany, Ohio.","Great Elm Group, Inc. engages in the durable medical equipment and investment management businesses. The company distributes respiratory care equipment, including positive air pressure equipment and supplies, ventilators and oxygen equipment, and replacement parts, as well as provides sleep study services; and rents medical equipment. It also offers investment management services. The company was formerly known as Great Elm Capital Group, Inc. and changed its name to Great Elm Group, Inc. in December 2020. Great Elm Group, Inc. was founded in 1994 and is headquartered in Waltham, Massachusetts.","DocGo, Inc. provides mobile health and medical transportation services for various health care providers in the United States and the United Kingdom. The company's transportation services include emergency response services; and non-emergency transport services comprise ambulance and wheelchair transportation services. It also offers mobile health services through its platform that are performed at home and offices; COVID-19 testing; and event services, which include on-site healthcare support at sporting events and concerts. DocGo, Inc. was incorporated in 2015 and is headquartered in New York, New York.","DoubleDown Interactive Co., Ltd. engages in the development and publishing of digital games
